pragma solidity ^0.7.1;
//SPDX-License-Identifier: UNLICENSED
import "../Interfaces/ITrustAnchorAttestation.sol";

interface ITrustAnchorStorage is ITrustAnchorAttestation {
    function setAttestation(address _identifiedAddress,
                            uint16 _jurisdiction,
                            uint64 _effectiveTime,
                            uint64 _expiryTime,
                            bytes memory _publicData,
                            bytes memory _documentsMatrixEncrypted,
                            bytes32 _availabilityAddressEncrypted,
                            bool _isManaged) external returns (uint8 result, bytes32 resultAttestationKeccak);

    function signAttestationTrustAnchorSignature(bytes32 _attestationKeccak,
                                                 uint8 _attestationValidityTrustAnchorSignatureV,
                                                 bytes32[2] memory _attestationValidityTrustAnchorSignatureRS) external returns (uint8 result);

    function signAttestationUserSignature(bytes32 _attestationKeccak,
                                          uint8 _attestationValidityUserSignatureV,
                                          bytes32[2] memory _attestationValidityUserSignatureRS) external returns (uint8 result);

    function revokeAttestation(bytes32 _attestationKeccak) external returns (uint8 result);
    function reenableAttestation(bytes32 _attestationKeccak) external returns (uint8 result);

    function addDataRetrievalTargetManaged( bytes32 _attestationKeccak,
                                            address _dataRetrievalTarget,
                                            bytes memory _documentsRetrievalConsentedEncrypted) external returns (uint8 result);
    function addDataRetrievalTargetFromIdentifiedAddress(bytes32 _attestationKeccak,
                                                        address _dataRetrievalTarget,
                                                        bytes memory _documentsRetrievalConsentedEncrypted) external returns (uint8 result);
    function removeDataRetrievalTargetManaged(bytes32 _attestationKeccak, address _dataRetrievalTarget) external returns (uint8 result);
    function removeDataRetrievalTargetFromIdentifiedAddress(bytes32 _attestationKeccak, address _dataRetrievalTarget) external returns (uint8 result);
    function dataRetrievalEntityValidateAttestation(bytes32 _attestationKeccak) external returns (uint8 result);

    function setDataRetrievalRevenueShare(address _trustAnchorAddress, uint32 _dataSharePercentage) external returns (uint8 result);
    function getDataRetrievalRevenueShare(address _identifiedAddress, address _trustAnchorAddress) external view returns (uint32 dataSharePercentage);
    //    function getAttestation(bytes32 _attestationKeccak) public view returns (trustAnchorAttestation attestation);

    function getAttestationKeccakArrayLengthForIdentifiedAddress(address _identifiedAddress) external view returns (uint16 keccakArrayLength);

    function getAttestationOriginalIdentifiedAddress(bytes32 _attestationKeccak) external view returns (address identifiedAddress);
    function getAttestationCurrentIdentifiedAddress(bytes32 _attestationKeccak) external view returns (address identifiedAddress);

    function getAttestationTrustAnchorAddress(bytes32 _attestationKeccak) external view returns (address trustAnchorAddress);
    function getAttestationTrustAnchorIndex(bytes32 _attestationKeccak) external view returns (uint32 trustAnchorIndex);

    function getAttestationKeccakArrayForIdentifiedAddress(address _identifiedAddress) external view returns (bytes32[] memory keccakArray);

    function getIndexedAttestationKeccakHashForIdentifiedUser(address _identifiedAddress,uint16 _index) external view returns (bytes32 keccakHash);
    function getIndexedAttestationJurisdictionForIdentifiedUser(address _identifiedAddress, uint16 _index) external view returns (uint16 jurisdiction);
    function getIndexedAttestationEffectiveTimeForIdentifiedUser(address _identifiedAddress, uint16 _index) external view returns (uint256 effectiveTime);
    function getIndexedAttestationExpiryTimeForIdentifiedUser(address _identifiedAddress, uint16 _index) external view returns (uint256 expiryTime);
    function getIndexedAttestationAvailabilityAddressEncryptedForIdentifiedUser(address _identifiedAddress, uint16 _index) external view returns (bytes32 availabilityAddressEncrypted);

    function getGraphConstructableAttestationInKeccakArray(address _identifiedAddress, uint16 _index) external view returns ( bytes32 keccakHash,
                                                                                                                            uint32 trustAnchorIndex,
                                                                                                                            uint16 jurisdiction,
                                                                                                                            bool attestationStatusApproved);

    function getAttestationComponentsInKeccakArray(address _identifiedAddress, uint16 _index) external view returns ( address trustAnchorAddress,
                                                                                                                    uint16 jurisdiction,
                                                                                                                    uint256 effectiveTime,
                                                                                                                    uint256 expiryTime,
                                                                                                                    bytes memory publicData,
                                                                                                                    bytes memory documentsMatrixEncrypted,
                                                                                                                    bytes32 availabilityAddressEncrypted,
                                                                                                                    bool isManaged,
                                                                                                                    uint32 identifiedAddressToTrustAnchorDataRetrievalRevenueShare);

    function getAttestationStatusApprovedInKeccakArray(address _identifiedAddress, uint16 _index) external view returns (bool attestationStatusApproved);
    function getConsentAvailableInKeccakArray(address _identifiedAddress, uint16 _index) external view returns (uint8 consentAvailable);
    function getTrustAnchorAddressInKeccakArray(address _identifiedAddress, uint16 _index) external view returns (address trustAnchorAddress);
    function getAttestationValiditySignaturesInKeccakArray(address _identifiedAddress, uint16 _index) external view returns ( uint8 validityTrustAnchorSignatureV,
                                                                                                                            bytes32[2] memory validityTrustAnchorSignatureRS,
                                                                                                                            uint8 validityUserSignatureV,
                                                                                                                            bytes32[2] memory validityUserSignatureRS);

    function getAttestationValidationsArrayLengthInKeccakArray(address _identifiedAddress, uint16 _index) external view returns (uint16 arrayLength);
    function getAttestationIsValidFromRetrieverInKeccakArray(address _identifiedAddress, uint16 _index, address _retrieverAddress) external view returns (bool isValid);
    function getAttestationIsValidFromRetriever(bytes32 _attestationKeccak, address _retrieverAddress) external view returns (bool isValid);
    function getAttestationAllValidations(bytes32 _attestationKeccak) external view returns (address[] memory validationEntities);

    function getAttestationDataRetrievalsArrayLengthInKeccakArray(address _identifiedAddress, uint16 _index) external view returns (uint16 arrayLength);
    function getAttestationIsRetrievableFromRetrieverInKeccakArray(address _identifiedAddress, uint16 _index, address _retrieverAddress) external view returns (bool isRetrievable);
    function getAttestationIsRetrievableFromRetriever(bytes32 _attestationKeccak, address _retrieverAddress) external view returns (bool isRetrievable);
    function getAttestationRetrievableDocumentsEncryptedFromRetriever(bytes32 _attestationKeccak, address _retrieverAddress) external view returns (bytes memory consentedDocumentsEncrypted);

    function getAttestationIsSentToRetrieverInKeccakArray(address _identifiedAddress, uint16 _index, address _retrieverAddress) external view returns (bool attestationWasSentToDataRetrievalEntity);
    function getAttestationDataWasSentToRetrievalEntity(bytes32 _attestationKeccak, address _retrieverAddress) external view returns (bool attestationWasSentToDataRetrievalEntity);
    function getAttestationDataWasSentToRetrievalEntityTimestamp(bytes32 _attestationKeccak, address _retrieverAddress) external view returns (uint256 attestationWasSentToDataRetrievalEntityTimestamp);

    function getAttestationIdentifiedAddressToTrustAnchorDataRetrievalRevenueSharePercentage(bytes32 attestationKeccak) external view returns (uint32 identifiedAddressToTrustAnchorDataRetrievalRevenueShare);

    function getAttestationKeccakToIdentifiedAddressAttestationKeccakArrayIndex(bytes32 _attestationKeccak) external view returns (uint16 keccakArrayIndex);
}
